import React from 'react';
import { Container, Row, Card, Carousel, Col, Button } from 'react-bootstrap';

const Testimoni = () => {
  return (
    <div className="mobile-padding">
    <Container id="Testimoni" className="mt-5 section-mb">
      <Row>
        <Col className="text-center">
          <h3 className="fw-bold">Testimonial</h3>
          <div className="line-horizontal"></div>
        </Col>
      </Row>
      <Row>
        <Col className="text-center mt-4">
          Berbagai review positif dari para pelanggan kami
        </Col>
      </Row>
      <Row className="mt-5">
        <Col sm={8} className="mx-auto">
          <Carousel>
            <Carousel.Item>
              <Card className="mb-3" style={{ backgroundColor: "#f1f3ff" }}>
                <Row className="g-0 mx-2 my-5">
                  <Col md={3} className="my-auto text-center">
                    <img
                      src="/image/img_testi.jpeg"
                      alt=""
                      className="img-fluid img-rounded"
                    />
                  </Col>
                  <Col md={8} className="text-start">
                    <Card.Body>
                      <img src="/image/Rate.png" alt="" style={{ height: "16px" }} className="img-fluid" />
                      <p className="mt-2">Lorem ipsum dolor sit amet consectetur, adipisicing elit.</p>
                      <strong className="mt-2">Angeline Tirza, Apoteker</strong>
                    </Card.Body>
                  </Col>
                </Row>
              </Card>
            </Carousel.Item>
            <Carousel.Item>
              <Card className="mb-3" style={{ backgroundColor: "#f1f3ff" }}>
                <Row className="g-0 mx-2 my-5">
                  <Col xs={12} md={4} className="my-auto text-center">
                    <img
                      src="/image/img_testi.jpeg"
                      alt=""
                      className="img-fluid img-rounded"
                    />
                  </Col>
                  <Col xs={12} md={8} className="text-start">
                    <Card.Body>
                      <img src="/image/Rate.png" alt="" style={{ height: "16px" }} className="img-fluid" />
                      <p className="mt-2">Lorem ipsum dolor sit amet, consectetur adipiscing elit, </p>
                      <strong className="mt-2">Paulus Stevanus, Kontraktor</strong>
                    </Card.Body>
                  </Col>
                </Row>
              </Card>
            </Carousel.Item>
          </Carousel>
        </Col>
      </Row>
      <Container className="mt-5">
    <Card className="text-center text-white p-3" style={{backgroundColor: "#576F72"}}>
          <Card.Body>
            <h2 className="fw-bold">Pilih internet berkualitas di Bekasi sekarang</h2>
            <Card.Body className="mb-3">
              Nusa Berkah Net hadir untuk memenuhi kebutuhan digital Anda dengan layanan Internet Premium terbaik!
            </Card.Body>
              <Button className="fw-bold text-white" style={{backgroundColor: "#E6BA95"}} href="/Product">Mulai Berlangganan</Button>
          </Card.Body>
        </Card>
    </Container>
    </Container>
    </div>
  );
};

export default Testimoni;
